const Sign = () => {
    return ( 
        <Container className="sign" fluid>
            <Row>
                <LeftComponent />
                <RightComponent />
            </Row>
        </Container>
    );
}
export default Sign;
function LeftComponent(){
    return (
        <Col className="signLeft">
            <img src={logo} alt="Logo Twiiter" />
            <h4>lado Izquierdo</h4>
        </Col>
    );
}
function RightComponent(){
    return (
        <Col className="signRight">
            <h4>lado Derecho</h4>
        </Col>
    );
}
